import './App.scss';
import 'bootstrap/dist/css/bootstrap.min.css';
import { MainNav } from './Navigation/nav';
import { AboutMe } from './AboutMe/aboutme';

function App() {
  return (
    <div className='App'>
      <MainNav />
      <div className='head-text'>
        <text>Shruti Bakutra</text>
      </div>
      <AboutMe />
    </div>
  );
}

export default App;
